comment_data.body:
@diegoflassa I'm glad that was helpful! I heard back from the JxBrowser team on additional steps we can take to understand the problem better.

If this issue recurs for you, you can check if a crash dump is generated by JxBrowser following the steps here: https://jxbrowser-support.teamdev.com/docs/guides/troubleshooting.html#unexpected-chromium-process-termination

If there's no log, there's probably something in our plugin causing Chromium to exit. Either way, let me know, and hopefully the JxBrowser team will be able to help us understand what could be happening.
